import React from "react";
import "./NavBar.css";
import MenuIcon from "@mui/icons-material/Menu";
import SearchIcon from "@mui/icons-material/Search";
import VideoCallIcon from "@mui/icons-material/VideoCall";
import NotificationsIcon from "@mui/icons-material/Notifications";
import Brightness4Icon from "@mui/icons-material/Brightness4";
import { Avatar } from "@mui/material";
export default function NavBar() {
  function ans()
  {
    var element = document.body;
    element.classList.toggle("img");
  }
  
  return (
    <div id="NavBar">
      <div id="First">
        <MenuIcon />

        <img id="YtLogo" src="ytlLogo.svg" alt="" />
      </div>

      <div id="Second">
        <input type="text" placeholder="Search....."   />
        <SearchIcon id="Searchicon" />
      </div>
      

      <div id="Third">
      <div>
        <Brightness4Icon id="Brightness4Icon"  />
      </div>
        <VideoCallIcon className="NavBarIcon" />
        <NotificationsIcon className="NavBarIcon" />
        <Avatar className="NavBarIcon">
          <img id="img123" src="home.jpg" onClick={()=>{ans()}} alt="sc hsb" />
        </Avatar>
      </div>
    </div>
  );
}
